import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

import Person from './Persons/Person';

class App extends Component {
  state = {
    persons : [
      {name: "Manu"}
    ]
  }

  onChangeHandler = () =>{
    this.setState = ({
      persons : [
        {name: "Manu Kapoor"}
      ]
    })
  }
  render() {
    return (
      <div className="App">
       <h1>Welcome</h1>
       <Person name ={this.state.persons[0].name} 
       changeName = {this.onChangeHandler}/>
      </div>
    );
  }
}

export default App;
